# 0のクエリに対する値
orig = 0xa9ad6be7eda43f1b2e0f3391c9aac2c156e1de7e582bdb2970bc5546cbd77c08bc4ab0afbf48ea6e5a58b317d00f1710c5c75ba21b68e47868db107a99dbbcdf136ab91d19eed18f335461876359861f3e1da6143dbda78117760b0472da1aa0685249c0c504fb440ac17729b8d4a79785ce4106ebdebdd19fcf57d4d3b71e81

mod = 
ans = Array.new(50, 0)
mul = 2
# query.txt には、 1bit目だけ立てたクエリで得られた値、2bit目だけ立てたクエリで得られた値、... を400行入れておく
IO.readlines('query.txt').each_with_index do |line, i|
	v = line.to_i(16)
	if orig * mul % mod != v
		ans[i / 8] += 2 ** (i % 8)
	end
	mul = mul * mul % mod
end
puts ans.reverse.map { |c| c.chr }.join
